import React from 'react';
import './Node.css';

const Node = ({ cx, cy }) => {
	// add the 'px' and convert cx, cy to strings
	var cx_str = cx + 'px';
	var cy_str = cy + 'px';

	// overwrite width, height and border-radius styles
	var circStyles = {
		borderRadius: '50%',
    	width: '100px',
    	height: '100px',
    	margin: cx_str,
	};


	return (
		<div style = {circStyles}>			
		</div>
	);
}

export default Node;
